import React, { Component } from 'react';
import { Link } from "react-router-dom";



class Nav extends Component {
    render() {
        return (

            <div className=" row justify-content-center my-1 d-flex">
                <div className="col-12 nav flex-column">
                    <Link to={'/inicio'}> <a className="btn btn-outline-success">Pasteles</a> </Link>
                    <Link to={'/inicio'}>Brownni</Link>
                    <Link to={'/inicio'}>Bizcochos</Link>
                    <Link to={'/inicio'}>Galletas</Link>
                    <Link to={'/inicio'}>Cremas Dulces</Link>
                    <Link to={'/inicio'}>Magdalenas</Link>
                    <Link to={'/inicio'}>Mousse</Link>
                    <Link to={'/inicio'}>Recetas Faciles</Link>
                </div>
            </div>
        )
    }
}

export default Nav;
